import mixedfruitbowl from '../../assets/mixedfruitbowl.jpeg'

const storeData = [
  { id: 1, name: '快乐西餐', icon: '/storeIcon1.png' },
  { id: 2, name: '麻辣汤', icon: '/storeIcon2.png' },
  { id: 3, name: 'BUSSIN 汉堡', icon: '/storeIcon3.png' },
  { id: 4, name: '水果吧', icon: '/storeIcon4.png' },
  { id: 5, name: '中式餐厅', icon: '/storeIcon5.png' }
];

export default storeData;
